import React from 'react';

import './index.css';

const imgStyle = {
    width: "150rem",
    height: "150rem"
};

class GameImg extends React.Component {
        
    render() {
        return (
            <>
            <div style = {imgStyle}>
            {this.name}      
            </div>
            </>
        );
    }
}

export default GameImg;
